import React from 'react';
import styled from 'styled-components';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

const IconWrapper = styled.span`
  display: inline-flex;
  align-items: center;
  justify-content: center;
  
  svg {
    font-size: 1.2rem;
  }
`;

export const SearchIcon = React.forwardRef((props, ref) => (
  <IconWrapper ref={ref} {...props}>
    <BsSearch />
  </IconWrapper>
));

export const ChartIcon = React.forwardRef((props, ref) => (
  <IconWrapper ref={ref} {...props}>
    <BsBarChart />
  </IconWrapper>
));

export const GearIcon = React.forwardRef((props, ref) => (
  <IconWrapper ref={ref} {...props}>
    <BsGear />
  </IconWrapper>
));

export const FileIcon = React.forwardRef((props, ref) => (
  <IconWrapper ref={ref} {...props}>
    <BsFileText />
  </IconWrapper>
));

export const FilterIcon = React.forwardRef((props, ref) => (
  <IconWrapper ref={ref} {...props}>
    <BsFilter />
  </IconWrapper>
));

export const SaveIcon = React.forwardRef((props, ref) => (
  <IconWrapper ref={ref} {...props}>
    <BsSave />
  </IconWrapper>
));

export const TrashIcon = React.forwardRef((props, ref) => (
  <IconWrapper ref={ref} {...props}>
    <BsTrash />
  </IconWrapper>
));

// Adicione nomes de exibição para depuração
SearchIcon.displayName = 'SearchIcon';
ChartIcon.displayName = 'ChartIcon';
GearIcon.displayName = 'GearIcon';
FileIcon.displayName = 'FileIcon';
FilterIcon.displayName = 'FilterIcon';
SaveIcon.displayName = 'SaveIcon';
TrashIcon.displayName = 'TrashIcon';
